import * as React from "react";
import {
  Box,
  Paper,
  IconButton,
  InputBase,
  // Table,
  // TableBody,
  // TableCell,
  // TableContainer,
  // TableHead,
  // TableRow,
} from "@mui/material";
import SearchIcon from "@mui/icons-material/Search";

import Navbars from "../Navbar/navbarHome2.js";
import Article from "../../Images/Article.png";
import Novel from "../../Images/Novel.png";
import Submovie from "../../Images/Submovie.png";
import Treatise from "../../Images/Treatise.png";
import Essay from "../../Images/Essay.png";
import Other from "../../Images/Other.png";
import Birth from "../../Images/Birth.png";
import HouseRegistration from "../../Images/HouseRegistration.png";
import IdentificationCard from "../../Images/IdentificationCard.png";
import MarriageCertificate from "../../Images/MarriageCertificate.png";
import DivorceCertificate from "../../Images/DivorceCertificate.png";
import DivorceRegistration from "../../Images/DivorceRegistration.png";

import {
  HomeEN,
  HomeDE,
  HomeTH,
  Translate01EN,
  Translate01DE,
  Translate01TH,
} from ".././Data/DataLanguage";

// import Avatar7 from "../../Images/Avatar7.png";
// import Avatar8 from "../../Images/Avatar8.png";
// import Avatar9 from "../../Images/Avatar9.png";
// import Avatar10 from "../../Images/Avatar10.png";
// import Avatar11 from "../../Images/Avatar11.png";

import { IoDocumentText, IoIdCardSharp } from "react-icons/io5";
import { RiUserSearchFill } from "react-icons/ri";
import DrawerInHome from "../Drawer/DrawerCustomer";
// import { fontSize } from "@mui/system";

import { useNavigate, useLocation } from "react-router-dom";

export default function Home2() {
  const navigate = useNavigate();
  const location = useLocation();

  let Doc = location?.state?.languages;
  console.log("Doc :", Doc);
  //   const [value, setValue] = React.useState(4);
  const [type, setType] = React.useState(1);
  const { innerWidth: width } = window;
  function createData(
    orderID,
    orderType,
    orderName,
    translator,
    orderPrice,
    orderedDate,
    status
  ) {
    return {
      orderID,
      orderType,
      orderName,
      translator,
      orderPrice,
      orderedDate,
      status,
    };
  }
  const rows = [
    createData(
      "0103",
      "General Document",
      "Novel",
      "Michael Lee",
      "$25",
      "05 June 2022",
      "00:21:35"
    ),
    createData(
      "0104",
      "Official Document",
      "Identification Card",
      "Sam Smith",
      "$42.5",
      "13 June 2022",
      "05:21:35"
    ),
    createData(
      "0105",
      "Official Document",
      "Certificate of use",
      "Michael Lee",
      "$31.2",
      "14 June 2022",
      "06:21:35"
    ),
  ];

  return (
    <div className="App-body-home2">
      <header className="App-header">
        {Doc === "English" ? (
          <Navbars navigate={navigate} languages="English" />
        ) : Doc === "Thai" ? (
          <Navbars navigate={navigate} languages="Thai" />
        ) : Doc === "German" ? (
          <Navbars navigate={navigate} languages="German" />
        ) : (
          <Navbars navigate={navigate} languages="English" />
        )}
      </header>
      <Box sx={{ display: "flex", width: "100% " }}>
        <DrawerInHome />
        {Doc === "English" ? (
          <>
            <div style={{ marginTop: 60, height: 100 }}>
              <h4
                style={{
                  fontWeight: 500,
                  fontSize: 36,
                  color: "#034D82",
                  marginLeft: 20,
                  position: "absolute",
                  top: "13%",
                }}
              >
                {HomeEN[0].label}
              </h4>
              <Paper
                component="form"
                sx={{
                  p: "2px 4px",
                  display: "flex",
                  alignItems: "center",
                  width: 330,
                  position: "absolute",
                  left: "75%",
                  top: "13%",
                  borderRadius: 20,
                  backgroundColor: "#FBFBFB",
                  boxShadow: "none",
                }}
              >
                <IconButton
                  type="submit"
                  sx={{ p: "10px", color: "#034D82" }}
                  aria-label="search"
                >
                  <SearchIcon />
                </IconButton>
                <InputBase
                  sx={{ ml: 1, flex: 1 }}
                  placeholder={HomeEN[1].label}
                  inputProps={{ "aria-label": "search google maps" }}
                />
              </Paper>
            </div>

            <div style={{ position: "absolute", left: 178, top: 180 }}>
              {type === 1 ? (
                <>
                  <button
                    style={{
                      width: width * 0.2,
                      background: "#FFFFFF",
                      color: "#0082E0",
                      height: 210,
                      border: "1px solid #E5E5E5",
                      borderRadius: 20,
                      fontSize: 20,
                      fontWeight: 600,
                      marginRight: 100,
                    }}
                    onClick={() => setType(1)}
                  >
                    <IoDocumentText style={{ width: "30%", height: "30%" }} />
                    <br />
                    <br />
                    {HomeEN[2].label}
                  </button>

                  <button
                    style={{
                      width: width * 0.2,
                      background: "#FFFFFF",
                      color: "#858585",
                      height: 210,
                      border: "1px solid #E5E5E5",
                      borderRadius: 20,
                      fontSize: 20,
                      fontWeight: 600,
                      marginRight: 100,
                    }}
                    onClick={() => setType(2)}
                  >
                    <IoIdCardSharp style={{ width: "30%", height: "30%" }} />
                    <br />
                    <br />
                    {HomeEN[3].label}
                  </button>

                  <button
                    style={{
                      width: width * 0.2,
                      background: "#FFFFFF",
                      color: "#858585",
                      height: 210,
                      border: "1px solid #E5E5E5",
                      borderRadius: 20,
                      fontSize: 20,
                      fontWeight: 600,
                      marginRight: 100,
                    }}
                    onClick={() => setType(3)}
                  >
                    <RiUserSearchFill style={{ width: "30%", height: "30%" }} />
                    <br />
                    <br />
                    {HomeEN[4].label}
                  </button>

                  <div
                    style={{
                      position: "absolute",
                      marginTop: 40,
                      display: "flex",
                      flexDirection: "row",
                      overflowX: "scroll",
                      maxWidth: "90%",
                    }}
                  >
                    <button
                      style={{
                        background: "#FBFBFB",
                        width: 180,
                        height: 180,
                        color: "#0079CC",
                        float: "left",
                        borderRadius: 20,
                        fontSize: 15,
                        fontWeight: 500,
                        marginRight: 30,
                        border: "none",
                      }}
                      onClick={() =>
                        navigate("/Matching", {
                          state: { id: 1, name: `${Translate01EN[1].label}`,languages:`$` },
                        })
                      }
                    >
                      <div
                        style={{
                          background: "rgb(236 248 255)",
                          borderRadius: 20,
                          width: 150,
                          margin: 15,
                          padding: 15,
                        }}
                      >
                        <img
                          src={Article}
                          alt="Article"
                          style={{
                            marginBottom: 10,
                            height: "auto",
                            width: 60,
                          }}
                        />
                      </div>
                      <p>{Translate01EN[1].label}</p>
                    </button>

                    <button
                      style={{
                        background: "#FBFBFB",
                        width: 180,
                        height: 180,
                        color: "#0079CC",
                        float: "left",
                        borderRadius: 20,
                        fontSize: 15,
                        fontWeight: 500,
                        marginRight: 30,
                        border: "none",
                      }}
                      onClick={() =>
                        navigate("/Matching", {
                          state: { id: 1, name: `${Translate01EN[2].label}`,languages:`$` },
                        })
                      }
                    >
                      <div
                        style={{
                          background: "rgb(236 248 255)",
                          borderRadius: 20,
                          width: 150,
                          margin: 15,
                          padding: 15,
                        }}
                      >
                        <img
                          src={Novel}
                          alt="Novel"
                          style={{
                            marginBottom: 10,
                            height: "auto",
                            width: 90,
                          }}
                        />
                      </div>
                      <p>{Translate01EN[2].label}</p>
                    </button>

                    <button
                      style={{
                        background: "#FBFBFB",
                        width: 180,
                        height: 180,
                        color: "#0079CC",
                        float: "left",
                        borderRadius: 20,
                        fontSize: 15,
                        fontWeight: 500,
                        marginRight: 30,
                        border: "none",
                      }}
                      onClick={() =>
                        navigate("/Matching", {
                          state: { id: 1, name: `${Translate01EN[3].label}`,languages:`$` },
                        })
                      }
                    >
                      <div
                        style={{
                          background: "rgb(236 248 255)",
                          borderRadius: 20,
                          width: 150,
                          margin: 15,
                          padding: 15,
                        }}
                      >
                        <img
                          src={Submovie}
                          alt="Submovie"
                          style={{
                            marginBottom: 10,
                            height: "auto",
                            width: 70,
                          }}
                        />
                      </div>
                      <p>{Translate01EN[3].label}</p>
                    </button>

                    <button
                      style={{
                        background: "#FBFBFB",
                        width: 180,
                        height: 180,
                        color: "#0079CC",
                        float: "left",
                        borderRadius: 20,
                        fontSize: 20,
                        fontWeight: 500,
                        marginRight: 30,
                        border: "none",
                      }}
                      onClick={() =>
                        navigate("/Matching", {
                          state: { id: 1, name: `${Translate01EN[4].label}`,languages:`$` },
                        })
                      }
                    >
                      <div
                        style={{
                          background: "rgb(236 248 255)",
                          borderRadius: 20,
                          width: 150,
                          margin: 15,
                          padding: 15,
                        }}
                      >
                        <img
                          src={Treatise}
                          style={{
                            marginBottom: 10,
                            height: "auto",
                            width: 60,
                          }}
                          alt="Treatise"
                        />
                      </div>
                      <p>{Translate01EN[4].label}</p>
                    </button>

                    <button
                      style={{
                        background: "#FBFBFB",
                        width: 180,
                        height: 180,
                        color: "#0079CC",
                        float: "left",
                        borderRadius: 20,
                        fontSize: 20,
                        fontWeight: 500,
                        marginRight: 30,
                        border: "none",
                      }}
                      onClick={() =>
                        navigate("/Matching", {
                          state: { id: 1, name: `${Translate01EN[5].label}`,languages:`$` },
                        })
                      }
                    >
                      <div
                        style={{
                          background: "rgb(236 248 255)",
                          borderRadius: 20,
                          width: 150,
                          margin: 15,
                          padding: 15,
                        }}
                      >
                        <img
                          src={Essay}
                          style={{
                            marginBottom: 10,
                            height: "auto",
                            width: 60,
                          }}
                          alt="Essay"
                        />
                      </div>
                      <p>{Translate01EN[5].label}</p>
                    </button>

                    <div
                      style={{
                        background: "#FBFBFB",
                        width: 180,
                        height: 180,
                        color: "#0079CC",
                        float: "left",
                        borderRadius: 20,
                        fontSize: 20,
                        fontWeight: 500,
                        marginRight: 30,
                      }}
                    >
                      <div
                        style={{
                          background: "rgb(236 248 255)",
                          borderRadius: 20,
                          width: 150,
                          margin: 15,
                          padding: 30,
                          height: 100,
                        }}
                      >
                        <img
                          src={Other}
                          alt="Other"
                          style={{
                            marginBottom: 10,
                            height: "auto",
                            width: 60,
                          }}
                        />
                      </div>
                      <p>{Translate01EN[6].label}</p>
                    </div>
                  </div>

                  <div
                    style={{
                      textAlign: "left",
                      position: "absolute",
                      top: 480,
                      width: "100%",
                    }}
                  >
                    {/* <p
                   style={{
                     textAlign: "center",
                     color: "#034D82",
                     fontSize: 20,
                     fontWeight: 600,
                   }}
                 >
                   Your Order
                 </p> */}
                    {/* <TableContainer component={Paper}>
                   <Table sx={{ minWidth: 1090 }}>
                     <TableHead style={{ background: "#263238" }}>
                       <TableRow>
                         <TableCell align="center" style={{ color: "#FFFFFF" }}>
                           Order ID
                         </TableCell>
                         <TableCell align="center" style={{ color: "#FFFFFF" }}>
                           Order type
                         </TableCell>
                         <TableCell align="center" style={{ color: "#FFFFFF" }}>
                           Order name
                         </TableCell>
                         <TableCell align="center" style={{ color: "#FFFFFF" }}>
                           Translator
                         </TableCell>
                         <TableCell align="center" style={{ color: "#FFFFFF" }}>
                           Order price
                         </TableCell>
                         <TableCell align="center" style={{ color: "#FFFFFF" }}>
                           Ordered date
                         </TableCell>
                         <TableCell align="center" style={{ color: "#FFFFFF" }}>
                           Status
                         </TableCell>
                       </TableRow>
                     </TableHead>
                     <TableBody>
                       {rows.map((row) => (
                         <TableRow
                           key={row.orderID}
                           sx={{
                             "&:last-child td, &:last-child th": { border: 0 },
                           }}
                         >
                           <TableCell component="th" scope="row">
